	return (
		<div className="App">
			<nav className="flex h-16 bg-black justify-around text-white shadow-2xl" >
				<h3 className="mt-5 font-bold text-xl"> Home </h3>
				<ul className="flex m-0 font- justify-around w-3/12 text-xl ">
					<li className="hover:mx-5 p-5 transition-all ">about</li>
